import React from 'react';
import './AboutMe.css'

function AboutMe(){
    return(
      <div id="aboutMeTile" className="aboutMe websiteBackground">
        <h1 className="aboutMeTitle">About Me</h1>
        <div class="aboutMeContent">
          {/* <div className="circle"></div> */}
          <p>Motivated and hardworking Bachelor of Science (B.Sc.) 
            graduate, in Computer Science; With 16 months of co-op work experience, 
            which included technical and comprehensive knowledge across all aspects 
            of computer programing, software tools, and concepts. Who comes with a passion 
            for continuous learning and professional development; seeking employment within 
            an organization to contribute effectively to a team, achieving mandated goals, 
            and seamless end-to-end productivity at all times. </p>
          </div>
      </div>
    );

}

export default AboutMe;
